					"esMX": "Al atacar con una habilidad de Imbuicin, obtienes un 20% de resistencia y un x20% de dao adicional para el elemento de esa Imbuicin durante 6 segundos.\n\nTags: Imbuement, Resistance, Damage, Non-Physical.",
