					"itIT": "Quando attacchi con un'abilit infusa ottieni il 20% di resistenza e il x20% di danni aggiuntivi per l'elemento dell'infusione per 6 s.\n\nTags: Imbuement, Resistance, Damage, Non-Physical.",
					"jaJP": "620%x20%\n\nTags: Imbuement, Resistance, Damage, Non-Physical.",
					"koKR": "   6       20%,    x20%.\n\nTags: Imbuement, Resistance, Damage, Non-Physical.",
					"plPL": "Kiedy atakujesz nasycon umiejtnoci, zyskujesz premi 20% do odpornoci i zadajesz zwikszone o x20% obraenia od ywiou tego nasycenia na 6 sek.\n\nTags: Imbuement, Resistance, Damage, Non-Physical.",
					"ptBR": "Ao atacar com uma habilidade de Imbuio, voc recebe 20% de resistncia e 20% de dano aumentado para o elemento da Imbuio por 6 segundos.\n\nTags: Imbuement, Resistance, Damage, Non-Physical.",
